import "./Home.css";
import facePhoto from "../../Images/Image/face-photo.png";
import LinkedinLogo from '../../Images/Logo/linkIn-logo.png'


export function aboutMe() {
    return (
        <div className="aboutMe-cont">
            <div id="aboutMe-text">

            </div>
        </div>
    );
}

export function MainButtons() {
    return (
        <div className="center-div">
            <div className="reveal-after-typeText resume-button-cont border-reveal">
                <a className="resume-button reveal-after-typeText" href=""> Resume </a>
            </div>
            <div className="reveal-after-typeText resume-button-cont border-reveal">
                <a className="reveal-after-typeText resume-button" href="">
                    Projects &lt;/&gt;
                </a>
            </div>
        </div>
    );
}

export function sideMenu() {
    return (
        <div className="sideMenu-container">
            <div id="aboutMe-text">
                <p className="name-text reveal-typeText">Minh Dao Nguyen</p>
                <p className="reveal-typeText aboutMe-text">
                    Texas A&M Computer Science
                </p>
                <p className="reveal-typeText aboutMe-text">
                    Software Engineer, Machine Learning, Data analytics.
                </p>
            </div>
            <div className = "">
                <ul>
                    <li> About </li>
                    <li> Experience </li>
                    <li> Projects </li>
                    <li> Others </li>
                </ul>
            </div>
            <div className="icons-container">
                <a href="https://www.linkedin.com/in/minhdaonguyen/">
                    <img src={LinkedinLogo} className="linkIn-logo" alt='LinkedIn logo' />
                </a>

            </div>
        </div>
    );
}
